import { useSelector, useDispatch } from 'react-redux';
import { useState } from 'react';
import React from 'react';

export const Page2 = (props) => {
    const [data, setData] = useState(props.location.state.data)

    return (
        <div>
            <div>
                Text Data {data.txt}
            </div>
            <div>
                Cbo {data.cbo}
            </div>
            <div>
                rad {data.rad}
            </div>
        </div>
    );
};
